import { IconButton, Stack } from "@mui/material";
import HomeRoundedIcon from "@mui/icons-material/HomeRounded";
import TagRoundedIcon from '@mui/icons-material/TagRounded';

export const NavBar = () => {
  return (
    <Stack>
      <IconButton>
        <HomeRoundedIcon />
      </IconButton>
      <IconButton>
        <TagRoundedIcon />
      </IconButton>
    </Stack>
  );
};
